import React, { Component } from 'react';
import { Button, Modal, ModalHeader, ModalBody } from 'reactstrap'
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import AllUser from './App';


class app extends Component {
    toggle() {
        return (
            <Router>
                <Route path="/AllUsers" >
                    {AllUser}
                </Route>
                <Link to="/AllUsers"></Link>
            </Router>
        )
    }
 
    render() {
        return (
            <Router>
                <div class="home">
                    <body class="container">
                        <header class="page-header">
                            <h1>Pi carre Login</h1>
                            <a>Home</a>
                        </header>
                        <Button
                            color="info"
                            onClick={this.toggle}
                            style={{ float: "left", marginRight: "10px" }}>"clique ici si t'es cap"
                        </Button>
                    </body>
                </div>
            </Router>
        )
    }
}
export default app;
